import { Box, SxProps, Theme, Button, TextField } from "@mui/material";


export const Main = () => {
    //1. ライブラリを読み込む
    var keypress = require('keypress');

    //2. keypressを標準入力に設定
    // make `process.stdin` begin emitting "keypress" events
    keypress(process.stdin);

    // 3. keypressイベントの購読を開始
    // listen for the "keypress" event
    process.stdin.on('keypress', function (ch, key) {

        // 4. key. で入力情報を取得
        console.log('got "keypress"', key);

        //Ctrl + c入力のときの処理
        if (key && key.ctrl && key.name == 'c') {
            process.stdin.pause();
            //強制終了するなら　process.stdin.exit();
        }
    });

    // 5. プロセス実行中のキー入力を拾うように設定
    process.stdin.setRawMode(true);
    process.stdin.resume();
    return (
        <Box className="HeMainader" sx={sx}>
            <Button variant="contained" onClick={() => {
                var base64 = '';
                var sound = new Audio("data:audio/wav;base64," + base64);
                sound.play();
            }} >
                aaa
            </Button>
            <TextField
                id="standard-basic"
                onKeyDown={e => {
                    if (e.key === 'Enter') {
                        // エンターキー押下時の処理
                        var base64 = '';
                        var sound = new Audio("data:audio/wav;base64," + base64);
                        sound.play();
                    }
                }}
            />
        </Box>
    );
};

const sx: SxProps<Theme> = {
    "&.Main": {
        width: "100%",
    },
};
